/*create relationship master table*/

CREATE TABLE `relationship_master` (
  `rel_id` int(11) NOT NULL AUTO_INCREMENT,
  `rel_name` varchar(50) NOT NULL,
  PRIMARY KEY (`rel_id`)
);

