CREATE PROCEDURE updateBatchFrequency(
in batchid INT,
in freq INT
)
BEGIN
update survey_batch 
set freq_id=freq
where survey_batch_id=batchid;
END //
DELIMITER 



DELIMITER //
CREATE PROCEDURE updateBatchDate(
in batchid INT,
in sdate INT,
in edate INT
)
BEGIN
update survey_batch 
set start_date=sdate,end_date=edate
where survey_batch_id=batchid;
END //
DELIMITER 



DELIMITER //
CREATE PROCEDURE updateQuestionDate(
in queid INT,
in sdate INT,
in edate INT
)
BEGIN
update question 
set startdate=sdate,enddate=edate
where que_id=queid;
END //
DELIMITER 


